import './App.css';
import { HashRouter } from "react-router-dom";
import { Routes, Route, Navigate } from "react-router";


function App() {
  return (
    <HashRouter>
      <Routes>
      <Route path="/"         element={<Navigate to="/"/>}/>
        <Route path="/Labs/*" element={<>HI</>} />
        <Route path="/Kanbas/*" element={<>HII</>} />
        <Route path="/hello" element={<>HIII</>} />
      </Routes>
    </HashRouter>

  );
}

export default App;
